  }
  Todo.fromMap(Map<String, dynamic> o) {
    id = o['id'] as int;
    userId = o['userId'] as int;

    title = o['title'] as String;

    completed = o['completed'] != null ? o['completed'] == 1 : null;

    isSaved = true;
  }
  // FIELDS
  int id;
  int userId;
  String title;
  bool completed;
  bool isSaved;
  BoolResult saveResult;
  // end FIELDS

